import React from 'react';
import { Helmet } from 'react-helmet';

export default function ApplicationMobile() {
  return (
    <main className="bg-[#181B20] min-h-screen text-white font-sans">
      <Helmet>
        <title>Développement d'application mobile à Nantes | NovaWeb</title>
        <meta name="description" content="Développement d'applications mobiles à Nantes et Pays de la Loire. iOS, Android, sur-mesure, UX/UI, accompagnement complet." />
      </Helmet>
      <section className="max-w-4xl mx-auto py-16 px-6">
        <h1 className="text-4xl font-bold mb-8 text-center">Développement d'application mobile à Nantes</h1>
        <p className="text-lg text-gray-300 mb-6 text-center">Créez une application mobile performante et intuitive pour iOS et Android. UX/UI moderne, fonctionnalités sur-mesure, accompagnement de A à Z.</p>
        <ul className="list-disc list-inside text-gray-300 mb-8">
          <li>Applications iOS & Android</li>
          <li>Design UX/UI personnalisé</li>
          <li>Développement sur-mesure</li>
          <li>Maintenance et évolutivité</li>
        </ul>
        <p className="text-center"><a href="/contact" className="cta-btn">Demander un devis</a></p>
      </section>
    </main>
  );
}
